import React from 'react';
import './App.css';
import AppList from './pages/AppList/AppList';
import { MemoryRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <Router forceRefresh={false}>
      <Switch>
        <Route path="/asdf">
          <h1>asdfdf</h1>
        </Route>
        <Route path="/" component={AppList} />
      </Switch>
    </Router>
  );
}

export default App;
